import { BrowserRouter,Routes,Route } from "react-router-dom";

import Login from "./component/login";
function App(){
  return(
    <div className="App">
      <BrowserRouter> 
      <Routes> 
        <Route element={<Login/>} path="/"/>
        <Route element={<Admin/>} path="/a"/>
      </Routes>
      </BrowserRouter>
     <h1>heloo </h1>
      
    </div>
  )
}
export default App;
